5db091e3-e69d-4530-9f29-95e2c334fa6d=About the AppSwitcher
6e364490-fe7c-4490-a571-16ce2d713061=
726e3889-5e6b-4f43-b288-810dd1685e4a=The App Switcher is a module that allows the end-user to see and switch between all the Mendix apps they have access to that are connected through Mendix SSO.
f7403f96-349e-4f3b-a8ba-bf19a206bf6f=
9cc8f3ac-68f2-473f-93b3-c05c03d2a537=Prerequisites
d6c2e454-a0f9-47dc-955f-0f58ba33ae6b=
6f8132d6-86ce-4482-b40d-83ea5542a31b=\u2022 Mendix Studio Pro 9.12.2 or higher.\r\n\u2022 Mendix SSO module installed (we recommend having this module updated to the latest version).\r\n
4e5af73d-592d-4370-8a1e-6f96739a574e=
6ba7fddf-2cf1-4812-87c8-bb858e1e4cd7=Configuration
43c8bfc5-e4ca-44ff-86a5-ce18fc809de8=
5d0811d0-b24f-4b01-a6b7-09939869139d=1. Install the App Switcher module and the Mendix SSO prerequisite module.\r\n2. Configure the user roles to have access to the user AppSwitcherModule module role.\r\n3. Move the App Switcher widget to the desired page or layout (you can find the widget in your toolbar in Add-ons).\r\n4. Make sure the end-user has to log in to Mendix SSO before accessing the page with the App Switcher widget.\r\n5. In the widget configuration, you can choose between two layouts\: context menu or left sidebar.
ee550ed5-f473-4085-9909-fff20eecd59e=
5d16b441-731c-436a-86e6-b51c3933dcce=Troubleshooting
f6be911f-8d7a-4dd2-8650-8e27d0ba4fd5=
e32d1026-6e5e-4200-8d6b-f4b903952465=If no apps are loaded for the end-user, please check the logs. Several error logs may appear\:
0c6d7a33-20e9-43b4-a601-5779a8e152b7=
5b9e745c-279b-4c67-aef8-b37b9274d8b2=\u2022 Failed to get an access token for user x.\r\n o The token cannot be retrieved.\r\n o Make sure Mendix SSO is correctly implemented and the user is logged into the application before accessing.\r\n\u2022 Failed to get custom authentication token for user x\r\n o This can happen for various reasons \u2013 check the HTTPResponse to see what the cause might be.\r\n  o No Error Code \u2013 The App Switcher cannot communicate with the server. Check if the AppSwitcher_Base_URL is correct or check Mendix Cloud Status. \r\n  o Error Code 400 \u2013 Bad request. The user ID does not match up or the wrong authentication token is being used. Make sure Mendix SSO is correctly implemented.\r\n  o Error Code 401 \u2013 Authentication error. The custom auth token expired or the widget is calling a non-corresponding environment.\r\n  o Error Code 404 \u2013 URL not found. Make sure the URL is correct.\r\n  o Error Code 500 \u2013 Authentication error. This can occur if the user-id is empty.\r\n  o Error Code 560 \u2013 Exception. User does not have the correct access. Make sure the user has access to the user module role in AppSwitcherModule.
