cd913f9e-b59a-45a4-8d6d-b78f1d609bff=ReadMe\r\n\=\=\=\=\=\=\=\r\n\r\nHow to configure\r\n----------------------------------------\r\n\r\nDo not modify this module, instead\:\r\n\r\n1. In the App settings (App Settings > Configurations > Constants), set the value of the 'EncryptionKey' constant to a 32 character string. This key will be used for encryption and decryption.\r\n2. Create a new module called 'EncryptionCustomizations'.\r\n3. Add new pages to this module, reuse snippets from the 'Encryption' module. \r\n    The pages in the 'Encryption' module can be used as examples.\r\n4. Create new microflows to replace the microflows which open forms. Generic microflows can be reused.
